export default function Todo(props) {
    return (
        <li className="todo-item">
          <div className="todo-outer-circle">
            <input id={props.id} type="checkbox" defaultChecked={props.completed} className="todo-inner-circle" />
            <label className="todo-text" htmlFor={props.id}>
              {props.name}
            </label>
          </div>
          <div className="btn-group">
            <button type="button" className="todo-delete">
              <span className="visually-hidden">{props.name}</span>
            </button>
          </div>
        </li>
    );
}
